use egg::{EGraph, Id, RecExpr, Rewrite, Symbol};

pub type RiseEGraph = EGraph<Rise, ()>;
pub type RiseExpr = RecExpr<Rise>;
pub type RiseRewrite = Rewrite<Rise, ()>;
pub type RiseAnalysis = ();

#[derive(Debug, PartialEq, Eq, PartialOrd, Ord, Clone, Hash, Copy)]
pub struct Index(pub usize);

impl std::str::FromStr for Index {
    type Err = Option<std::num::ParseIntError>;

    fn from_str(s: &str) -> Result<Self, Self::Err> {
        if let Some(stripped_s) = s.strip_prefix("%") {
            stripped_s.parse().map(Index).map_err(Some)
        } else {
            Err(None)
        }
    }
}

impl std::fmt::Display for Index {
    fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result {
        write!(f, "%{}", self.0)
    }
}

egg::define_language! {
  pub enum Rise {
    Var(Index),
    "app" = App([Id; 2]),
    "lam" = Lambda(Id),
    "typeOf" = TypeOf([Id; 2]),

    // to implement explicit substitution:
    // "sig" = Sigma([Id; 3]),
    // "phi" = Phi([Id; 3]),

    Integer(isize),
    // Float(f32),
    // Double(f64),
    Symbol(Symbol),
  }
}

